import React, {useState, useEffect} from 'react';

function App() {
    const [message, setMessage]=useState([]);
    useEffect(()=>{
        fetch("/api/test")
            .then((res)=>{
                setMessage(res.data)
            })
    });
    return (
        <div>
            {message}
        </div>
    );
}

export default App;
